import React, { Fragment } from 'react';
import Sheet from 'react-modal-sheet';
import "./styles.css";


const PlaceABidSoftwareActionHelper = ({ sheetBidOpen, setSheetPaneOpen }) => {
    return (
        <Fragment>
            <Sheet isOpen={sheetBidOpen} onClose={() => setSheetPaneOpen(false)}>
                <Sheet.Container>
                <Sheet.Header>
                    <div className='marginized-top-header'>
                        <Button className='btn-square-danger' color='danger-2x' style={{ width: "100%" }} outline onClick={() => setSheetPaneOpen(true)}>Cancel/Close Pane</Button>
                    </div>
                </Sheet.Header>
                <Sheet.Content>{/* Your sheet content goes here */}</Sheet.Content>
                </Sheet.Container>

                <Sheet.Backdrop />
            </Sheet>
        </Fragment>
    );
}

export default PlaceABidSoftwareActionHelper;
